<script>
    // 모든 주요 개발자 도구 단축키 및 특수 키 차단
    document.addEventListener("keydown", function(event) {
        // F12 (Windows/Linux)
        if (event.keyCode === 123) {
            event.preventDefault();
            alert("F12는 비활성화되었습니다.");
        }
        // CMD + Alt + I (Mac)
        if (event.metaKey && event.altKey && event.keyCode === 73) {
            event.preventDefault();
            alert("CMD+Alt+I는 비활성화되었습니다.");
        }
        // Ctrl + Shift + I (Windows/Linux)
        if (event.ctrlKey && event.shiftKey && event.keyCode === 73) {
            event.preventDefault();
            alert("Ctrl+Shift+I는 비활성화되었습니다.");
        }
        // Ctrl + Shift + J (Windows/Linux)
        if (event.ctrlKey && event.shiftKey && event.keyCode === 74) {
            event.preventDefault();
            alert("Ctrl+Shift+J는 비활성화되었습니다.");
        }
        // CMD + Shift + I (Mac)
        if (event.metaKey && event.shiftKey && event.keyCode === 73) {
            event.preventDefault();
            alert("CMD+Shift+I는 비활성화되었습니다.");
        }
        // Ctrl + U (소스 보기)
        if (event.ctrlKey && event.keyCode === 85) {
            event.preventDefault();
            alert("Ctrl+U는 비활성화되었습니다.");
        }
        // Ctrl + Shift + C (개발자 도구에서 요소 선택)
        if (event.ctrlKey && event.shiftKey && event.keyCode === 67) {
            event.preventDefault();
            alert("Ctrl+Shift+C는 비활성화되었습니다.");
        }
        // Alt + F4 (윈도우 종료)
        if (event.altKey && event.keyCode === 115) {
            event.preventDefault();
            alert("Alt+F4는 비활성화되었습니다.");
        }
        // Ctrl + S (저장)
        if (event.ctrlKey && event.keyCode === 83) {
            event.preventDefault();
            alert("Ctrl+S는 비활성화되었습니다.");
        }
        // F5 (새로고침)
        if (event.keyCode === 116) {
            event.preventDefault();
            alert("F5는 비활성화되었습니다.");
        }
        // Ctrl + R (새로고침)
        if (event.ctrlKey && event.keyCode === 82) {
            event.preventDefault();
            alert("Ctrl+R은 비활성화되었습니다.");
        }

        // CMD + Shift + C (Mac에서 요소 선택)
        if (event.metaKey && event.shiftKey && event.keyCode === 67) {
            event.preventDefault();
            alert("CMD+Shift+C는 비활성화되었습니다.");
        }
        // CMD + Shift + J (Mac에서 콘솔 열기)
        if (event.metaKey && event.shiftKey && event.keyCode === 74) {
            event.preventDefault();
            alert("CMD+Shift+J는 비활성화되었습니다.");
        }
        // Alt + Shift + I (Chrome 개발자 도구 열기)
        if (event.altKey && event.shiftKey && event.keyCode === 73) {
            event.preventDefault();
            alert("Alt+Shift+I는 비활성화되었습니다.");
        }
        // CMD + Alt + I (Mac에서 개발자 도구 열기)
        if (event.metaKey && event.altKey && event.keyCode === 73) {
            event.preventDefault();
            alert("CMD+Alt+I는 비활성화되었습니다.");
        }
    });
    
    // 마우스 우클릭 차단
    document.addEventListener("contextmenu", function(event) {
        event.preventDefault();
        alert("우클릭이 비활성화되었습니다.");
    });
    
    // 크기 변경 방지
    window.onresize = function() {
        alert("창 크기 변경이 제한됩니다.");
        window.resizeTo(1024, 768); // 고정 크기로 설정
        return false;
    };
    
    
    // 창 크기 변경 방지
    document.addEventListener("keydown", function(event) {
        if (event.key === "F11" || event.key === "Escape" || event.key === "F5") {
            event.preventDefault();
        }
    });
    
    // 마우스 이벤트 차단
    document.addEventListener("mousedown", function(event) {
        if (event.button === 2) { // 우클릭
            event.preventDefault();
            alert("우클릭이 비활성화되었습니다.");
        }
    });
    
    // Ctrl + Shift + T (새 탭에서 페이지 열기)
    document.addEventListener("keydown", function(event) {
        if (event.ctrlKey && event.shiftKey && event.keyCode === 84) {
            event.preventDefault();
            alert("Ctrl+Shift+T는 비활성화되었습니다.");
        }
    });
    </script>
